import React from 'react'
import {BrowserRouter, Route, NavLink} from "react-router-dom";
import createBrowserHistory from "history/createBrowserHistory";
import GraciaFinal from '../GraciaFinal/Main'
import Interlude from '../Interlude/Main'

const history = createBrowserHistory();

const Menu = () => (

        <div className={'menu-container'}>
            <nav>
                <NavLink to="/">Interlude</NavLink>
                {/*<a href="#">Interlude</a>*/}
                <NavLink to="/graciafinal">Gracia: Final</NavLink>
                {/*<a href="#">Gracia: Final</a>*/}
                <a href="#">Gracia: Epilogue</a>
                <a href="#">Freya</a>
                <a href="#">High Five 5</a>
                <a href="#">Classic</a>
            </nav>
        </div>

);

export default Menu
